import React from 'react';
import { AuthProvider } from './contexts/AuthContext';
import { CartProvider } from './contexts/CartContext';
import { SocketProvider } from './contexts/SocketContext';
import AppRouter from './AppRouter';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <SocketProvider>
          <AppRouter />
        </SocketProvider>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
